import { useState } from 'react';
import './App.css';
import Person from "./Components/Person"
function App() {
  const [name,setName]=useState([
    {name:"irtaza", age:20},
    {name:"zeeja", age:19},
    {name:"talha", age:21},
  ])
  function NameChange(){
setName("zeeja")
  }
  function Change(event){
setName(event.target.value)
  }
  return (
    <div className="App">
     <h2>hello</h2>
     <button onClick={NameChange}>Change</button>
     {name.map((name)=>(
 <Person change={Change} click={NameChange} name={name}/>
     ))}


    </div>
  );
}

export default App;
